import React from 'react';
import chirag_img from './Chirag.png';
import './About.css';

const About = () => {
  return (
   
    <div className="about-section">
        <div className="about-abovecontent">
            <h2 class>Why Choode Our SDET Programe?</h2>
            <p className='about_para'>Our comprehensive program is designed by industry experts to provide hands-on experience with the latest testing tools and methodologies used by top tech companies.

</p>
        </div>
    </div>
   
  );
};

export default About;
